INSERT INTO `t_vr_video` VALUES ('40005', '1', '【全景】恐怖房间', '', '40005', 'mp4', '20141924', '8302', '新用户8302', '1', '2016-05-27 11:45:37', '[\"http:\\/\\/d5.lgshouyou.com\\/vr\\/va\\/40005.png\",\"http:\\/\\/d5.lgshouyou.com\\/vr\\/va\\/40005.png\"]', '[\"http:\\/\\/d5.lgshouyou.com\\/vr\\/va\\/40005.mp4\",\"http:\\/\\/d5.lgshouyou.com\\/vr\\/va\\/40005.2.mp4\"]', '美女一个人睡在家里，会发生什么不可思议的恐怖事件呢\r\n昨天，武汉度过了近3年来最热的一个午后，最高气温冲到了38.4℃左右。不过，本轮热浪已近尾声，随着阵雨的光临，明天起我市热度减退，后天最高气温有望降至35℃以下。\r\n近3年最热午后——\r\n中心城区局地最高温超40℃气温就突破了37℃的酷暑日门槛线，到下午最高气温定格在了38.4℃左右。黄陂站等国家级气象站昨天的最高气温超过39℃。而在中心城区的区域自动气象站中，气温最高的是武汉十四中站，为40.4℃，常青路站40.2℃、湖北大学站40.1℃排名第二和第三。\r\n位于东西湖慈惠农场的武汉气象站的数据，一般是武汉天气的代表数据，上一次武汉站出现38℃以上的最高气温，还要追溯到2013年的8月中旬。2014年和2015年，武汉夏天都比较凉快，去年夏天武汉站的极端最高气温还不到37℃。\r\n武汉气象史上的最高温出现在2003年8月1日，39.6℃。\r\n强对流来袭——', '三人同行', '{\"be_fp\":\"0\",\"be_qj\":\"0\",\"score\":\"6\"}', '1480930835', '0', '');
