INSERT INTO `t_vr_video` VALUES ('40068', '1', '欢迎来武汉看海', '', '40068', 'mp4', '285217367', '1', 'test_1', '0', '2016-06-07 17:37:52', '[\"http://d5.lgshouyou.com/vr/va/40068.png\"]', '[\"http://d5.lgshouyou.com/vr/va/40068.mp4\"]', '2016年06月01日，暴雨突袭武汉，强劲的暴雨导致路面积水难以扩散，短时间内武汉城区已经切换到了“大海”模式，人们出行只能穿着短裤拖鞋，多处路段积水直接将汽车淹没，只剩车顶隐约可见。', null, null, '1465292272', '0', '');
INSERT INTO `t_vr_video` VALUES ('40069', '1', '六一不知去哪玩?不妨叫个嘀嘀打船到武汉看海', '', '40069', 'mp4', '144038478', '1', 'test_1', '0', '2016-06-07 17:37:52', '[\"http://d5.lgshouyou.com/vr/va/40069.png\"]', '[\"http://d5.lgshouyou.com/vr/va/40069.mp4\"]', '武汉市遭遇了今年最强暴雨，部分城区最高降雨量达到115毫米。暴雨导致武汉城区数十处地段出现内涝，重要交通道路被阻造成拥堵。', null, null, '1465292272', '0', '');
