INSERT INTO `t_vr_video` VALUES ('50001', '1', '地心引力', '', '50001', 'mp4', '2085862141', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50001.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50001.mp4\"]', '一个在探索者号航天飞机上的两名男宇航员和一个女宇航员出舱进行哈勃望远镜维修时，遭遇太空碎片袭击导致飞船发生严重事故后在太空中发生的故事。由于其他同行全部丧生，所以这部在太空领域内的“密闭空间”式电影人物极少，影片后半部分几乎只有桑德拉·布洛克主演的女主角一人，她将面对的是残酷的宇宙环境的人类内心中无限的孤独和恐惧。', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50002', '1', '绝命海拔', '', '50002', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50002.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50002.mp4\"]', '由罗布·霍尔和史考特·费雪带队，两人都是世界著名登山家，其中史考特·费雪是第五次攀登珠峰。不幸的是他们在登山过程中遭遇了特大风暴，在这场灾难中，8位登山者不幸丧生。贝克·威瑟斯是一名医生，一名来自西雅图的登山者道格·汉森，因为他的登山速度缓慢，给团队带来了灾难性的麻烦', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50003', '1', '极盗者', '', '50003', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50003.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50003.mp4\"]', '一位年轻的FBI特工强尼·犹他，潜伏到一队寻找刺激的精英运动员里—该队伍由富有个人魅力的鲍迪领导。这些运动员们被怀疑是在用极不寻常的方式进行着系列犯罪。在与鲍迪这一伙人的交往中，犹他发现自己无可自拔的与这伙人产生了伙伴情谊，并在他们的生活方式和理念中找到了自我。最终，犹他陷入了职业伦理与追求真我之间的矛盾，他放弃了自己的一切，加入到了对极限运动界的八项巅峰挑战！', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50004', '1', '复仇者联盟2', '', '50004', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50004.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50004.mp4\"]', '身经百战的超级英雄们产生了职业倦怠，已经卸下钢铁战甲的托尼·斯塔克因此发明了“奥创”——有自我意识、有学习能力的人工智能机器人，并将指挥机器人军团的重任交给奥创。令超级英雄们始料不及的是，不断进化的奥创得出了“人类是地球上最大的威胁”这一结论，进而开始实施清洗人类的毁灭计划。有强大能力的改造人兄妹快银和猩红女巫也成为奥创的帮手，四处制造麻烦。复仇者联盟必须再度集合，解决这个由他们亲手制造的危机。', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50005', '1', '冰雪奇缘', '', '50005', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50005.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50005.mp4\"]', '影片讲述小国阿伦黛尔因一个魔咒永远地被冰天雪地覆盖，为了寻回夏天，安娜公主和山民克里斯托夫以及他的驯鹿搭档组队出发，为展开一段拯救王国的历险。', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50006', '1', '变形金刚4：绝迹重生', '', '50006', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50006.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50006.mp4\"]', '那一场轰动全人类的“芝加哥决战”的四年后，智能机器人汽车人与霸天虎已然从地球上销声匿迹，存活下来的人类也在大战之后开始了新生。而多年来执着于“旧货”的凯德，竟无意中“收留”了沉睡中的擎天柱。随着邪恶势力的再次临近，人类和他们曾经的盟友汽车人的平静日子终于再次被打破，而这一次不可避免的大战，显然比以往来得更加凶猛，霸天虎，以及来自古老的变形金刚阵营的威胁，正大踏步向着这颗渺小的星球逼近！', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50007', '1', '咒怨：完结篇', '', '50007', 'mp4', '1798868452', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50007.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50007.mp4\"]', '小学教师结衣离奇失踪，姐姐麻衣（平爱梨 饰）为了找寻妹妹的下落，推开了妹妹失踪前经常拜访的学生家的大门。而同时，女高中生玲央家里收养了一名母亲去世的孤儿俊雄，由此也发生了一连串恐怖事件。', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50008', '1', '夜航惊魂', '', '50008', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50008.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50008.mp4\"]', '故事从一起惨绝人寰的008班机空难揭开序幕，这场空难仅有一名幸存者——空姐苏妮。经过调查发现，该架008号班机之前已有过几次死亡事故，但恶质的航空公司，将机身修复并重新粉刷，旋即重返机场进行载运工作。坠机死亡的冤魂，由于并非生命善终而亡，魂魄只能徘徊失事地点杀人解怨，好让自己升天轮回；因此事后苏妮每次工作，经常看见许多灵体拉着乘客不放；不堪其扰的苏妮，毅然辞职返家休养。三年后，苏妮调理好身体状况，到另一家航空公司上班；她想重新开始新的生活，但坠机噩梦总让她半夜惊醒。某日的飞航，熟悉的画面又重回眼前，原来之前那台班机，在重新包装后又死灰复燃，将带着旅客飞向他们最后一次的旅程', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50009', '1', '昆虫总动员', '', '50009', 'mp4', '2095315377', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50009.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50009.mp4\"]', '在一片宁静的丛林里，在人类的行迹之下，掩藏着一个生机勃勃、热闹非凡的昆虫世界。一只瓢虫遭遇丛林各色虫类追赶，又闯入红黑蚂蚁的战争现场，亲身见证一场昆虫界的“特洛伊攻城”', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50010', '1', '星际迷航：暗黑无界', '', '50010', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50010.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50010.mp4\"]', '新的续集故事讲述的是一个关于复仇的故事。寇克船长因执行任务时暴露“企业号”行踪，被上级取消了进取号船长的资格。一名叫约翰·哈里森的神秘人在23世纪的伦敦制造了一起恐怖爆炸，并袭击了星际联邦总部，整个星球陷入了混乱状态。寇克被重新任命为舰长，他带着大家开始追捕破坏分子，寻找元凶。', null, null, '1465292273', '0', '');
