INSERT INTO `t_vr_video` VALUES ('50012', '1', '死神来了5', '', '50012', 'mp4', '2092469517', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50012.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50012.mp4\"]', '影片讲述的是一场高架索桥倒塌引发的死亡事件中，几个幸运儿侥幸逃生，但死神显然没有放过他们，接下来，又是一场场意外接踵发生。', null, null, '1465292273', '0', '');
INSERT INTO `t_vr_video` VALUES ('50013', '1', '蚁人', '', '50013', 'mp4', '2147483647', '1', 'test_1', '0', '2016-06-07 17:37:53', '[\"http://d5.lgshouyou.com/vr/va/50013.png\"]', '[\"http://d5.lgshouyou.com/vr/va/50013.mp4\"]', '行骗为生的斯科特·朗，在偷了生化学家汉克·皮姆博士发明的蚁人战服后，拥有了自由收缩身体大小的超能力。汉克·皮姆博士开发出一种“皮姆粒子”，并和斯科特·朗一同成为“蚁人”。斯科特也不得不接受自己的英雄身份，并帮助皮姆博士守护蚁人技术之谜。在强大的敌人威胁下，两人必须精心策划并执行一场惊天骗局来拯救世界维护和平。', null, null, '1465292273', '0', '');
