INSERT INTO `t_vr_video_detail` VALUES ('11', 'V字仇杀队', 'http://tk.bluevr.cn/down.php?url=http://test2.bluevr.cn/vr/va/11.mp4', '', '0', '0', '影片讲述的故事发生在虚拟的未来世界，那时的英国变成了一个由独裁者萨特勒所统治的法西斯极权主义国家，人民生活方在残暴的统治下，疾病、饥荒、灰暗，且秘密警察无处不在。在这里，外国人、同性恋者和反对人士都会被抓入集中营处死。\r\n\r\n艾维是生活在这个国度的一个柔软的少女，一次她不幸落入了政府爪牙的魔爪，就在生死危急的关头，一个头带一张露齿而笑的面具，身披斗蓬的神秘怪人将她拯救了出来，临走时这个神秘怪人告诉艾维他叫作“V”。不久，艾维又被抓进了集中营，看守剃光了她的头发，对她百般凌辱。而这一次，神秘怪人“V”再次适时而出，将艾维救出了火坑。“V”告诉艾维，自己是一个用极端暴力手段对抗政府的所谓“斗士”，目前正在策划一个计划，他准备效仿1605年的盖伊·福克斯，1605年，盖伊·福克斯和同伴在国会大厦下面埋了36桶炸药企图将当时的残酷的独裁政权轰掉，但计划败露，被英王詹姆斯一世于当年11月5日绞死。而他所带的面具就是英国人一眼就能认出了盖伊·福克斯。艾维被这个具有不可思议的战斗能力，诡计多端且手段极其残忍的“V”所吸引，决定加入“V”的行列，和V一起组成了“V字仇杀队”。\r\n\r\n“V”的计划在顺利进行，他在一连炸毁了伦敦两处标志性建筑后，夺取了政府控制的广播电台。他煽动市民进行起义，并呼吁大家在11月5日那天和他一起将国会大厦炸毁。', '3444', '0', '0', '', 'http://d5.bluevr.cn/vr/va/11.jpg', 'http://d5.bluevr.cn/vr/va/11_v.jpg', '2017', '132分钟', '欧美', '', '1', '9.7', '0', '720P', '网络', '[]', '1', '1', '0', '', '', '0', '0', '{\"score\":\"5\"}', '[]', null, '0');
