INSERT INTO `t_vr_web_article` VALUES ('40', '[\"3\"]', '恐怖众议院VR游戏评测 准备', '<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<strong>历时8个月 华为VR眼镜终于开售 599元到底值不值？</strong>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	在 4 月 17 日下午的 P9 发布会上，华为正式推出其首款 VR 眼镜，然而华为当时并没公布具体上市时间，直到近期，华为才在微博上表示其 VR 眼镜将<span style=\"line-height:1.5;\">于 12 月 15 日同华为 Mate 9 Pro 同步国内首销，而此时距离华为 VR 首秀已过去了将近 8 个月。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;text-align:center;\">\r\n	<span style=\"line-height:1.5;\"><img src=\"http://img5.lgshouyou.com/vr/web_public/images/vr_616.jpg\" title=\"历时8个月 华为VR眼镜终于开售 599元到底值不值？\" alt=\"历时8个月 华为VR眼镜终于开售 599元到底值不值？\" /><br />\r\n</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">华为 VR 眼镜采用白色机身，T 形头带，同时拥有防蓝光、防反射镀膜，20ms 低时延，可减少眩晕感，95 度视场角度，拥有 360°视觉声场同步技术。目前仅适配华为 Mate 9 Pro、Mate 9 保时捷设计和华为 P9 Plus 三款 5.5 英寸的手机。内容上，目前可提供 5000 多部免费电影、500 多张全景图片，200 多部全景漫游以及 40 多部免费游戏等。另外，据介绍，华为 VR 眼镜还提供了 0-700 度近视调节，无需佩戴近视眼镜也可以轻松体验 VR 乐趣。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">价格方面， 华为 VR 眼镜定价 599 元，明显高于稍早前发售的 199 元的小米 VR 正式版，基本与 99 美元的三星 Gear VR 以及 79 美元的谷歌 Daydream View 处于同一水平线 。看来，华为貌似对自己的 VR 产品特别有信心！</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;color:#E53333;\"><strong>为什么敢卖这么贵？</strong></span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">据了解，手机 VR 难点之一便是延迟，VR 延迟必须少于 20 毫秒，否则用户戴一会儿就得吐一地了。而要解决这个问题，有 VR 行业人士表示只有两个办法，一个是靠向谷歌这样的企业对操作系统进行底层优化，二是靠英特尔、高通这样的芯片企业对芯片进行相关优化。而华为恰恰有能力同时做这两点。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">11 月中旬，余承东便已经在 Mate 9 Pro 发布会后表示，平台方面华为 VR 的底层完全是自己开发，余承东说“谷歌 Daydream 不是开源的、Oculus 也不是开源的，所以华为自己全新搭建了这个 VR 平台。”虽然华为自己搭建底层并不同于谷歌对安卓系统底层的优化，但要知道体验效果尚可的三星 Gear VR 也要归功于 Oculus 提供的优化。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">而更重要的，华为也有着自己的麒麟芯片，虽然麒麟芯片与三星、高通的顶级芯片还有一定的差距，但这应该并不妨碍华为通过芯片上的优化提升 VR 的体验。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">以上两点或许就是华为 VR 之所以敢在价格上叫板三星与谷歌的原因吧。当然，至于华为 VR 会不会晕，我们仍有待后续实际体验。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">然而，华为却貌似并未发挥自己应有实力。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">在创新能力上，华为绝对是有硬实力的，比如此前华为荣耀 7i 上的可翻转摄像头，以及连苹果都效法的双摄像头设计，无不说明了华为的创新能力。然而，在华为 VR 上面，我们似乎并没有看见华为的创新。其不仅在 USB 接口设计上，还是在卡扣设计以及头戴设计上，处处可见三星 Gear VR 的痕迹。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">华为最大的优势就是在红海中也能争得自己的一份天地，比如手机业务就是最明显的例子，华为虽然并不是最早进入手机市场的企业，但到现在其却已经成了市场上最成功的智能手机企业之一。在 2016 年第三季度全球智能手机出货量排行榜中，华为仅排在三星与苹果之后位列第三。</span>\r\n</p>\r\n<p style=\"font-family:微软雅黑;text-indent:35px;color:#455A6D;font-size:15px;background-color:#FFFFFF;\">\r\n	<span style=\"line-height:1.5;\">众所周知，VR 目前还处于一个非常早期的阶段，华为 VR 迟到近 8 个月，以及疑似未发挥应有实力难道是还在等待 VR 最后的成熟？</span>\r\n</p>', 'http://192.168.0.88\\vr2.0\\vr_admin\\common\\web_public\\images\\game.png', '1486201001', '1486982058', '1503374800', '1702041735', '安卓模拟器,蓝光手游大师,电脑玩手游,手机游戏电脑版,手机游戏PC版,蓝光手游大师官网&&蓝光手游大师是一款电脑上的安卓模拟器管理软件,实现用电脑玩手游的目的,是中国最流畅的安卓模拟器管理软件,为玩家提供最好的电脑玩手游服务。', '通过VR来体验恐怖类游戏带来的震撼感还是相当不错的，不过大部分的玩家可能还无法接受，当然这并不代表恐怖类游戏就不好玩，相信还是有一部分', '{\"attach_author_img\":\"\",\"attach_author_name\":\"\",\"attach_dz\":\"44\",\"attach_yd\":\"\",\"attach_qd\":\"\",\"attach_pf\":\"7\",\"attach_dx\":\"\",\"attach_url\":\"\",\"attach_article_sort\":\"game\"}');
